import { useEffect, useState } from 'react';

function TimeRangeSlider(props) {


  return (
    <Marker position={latlng} id={props.id}>
        <Popup maxWidth="100%">
          <h1>{props.date}</h1>
          <img src={"http://localhost:3001/api/v1/image/" + props.filename} alt="sick pic" class="marker-picture" />
          <p>{props.notes}</p>
        </Popup>
    </Marker>
  );
}

export default TimeRangeSlider;
